{
  debug(LOW, "HNF curry:\n");
  debug_expr(LOW, root);
  field v2;
  field v3;
  field v4;
  field v5;
  v4 = child_at(root, 0);
  field v4_forward = v4;
  v3 = child_at(root, 1);
  field v3_forward = v3;
  v2 = child_at(root, 2);
  field v2_forward = v2;
  v5 = make_Prelude__LP_CM_RP(v3, v4, 0);
  field v5_forward = v5;
  set_apply1(root, v2, v5);
  apply_hnf(root);
  debug(LOW, "leaving curry\n");
  debug_expr(LOW, root);
  return;
}

